import React, { useEffect, useState } from 'react';
import Axios from 'axios';
import './AddWorkoutStyle.css';

const AddWorkout = () => {
    const [showMessage, setShowMessage] = useState(false);
    const [exercise, setExercise] = useState("");
    const [sets, setSets] = useState(0);
    const [reps, setReps] = useState("");
    const [weight, setWeight] = useState("");
    const [tableName, setTableName] = useState("");
    const [exerciseList, setExerciseList] = useState([]);
    const [showExercises, setShowExercises] = useState(false);

    // Function to fetch exercises
    const getExercises = () => {
        Axios.get('http://localhost:3001/exercises')
            .then((response) => setExerciseList(response.data))
            .catch(error => console.error('Error fetching exercises:', error));
    };

    // Function to toggle the visibility of exercise list
    const toggleShowExercises = () => {
        setShowExercises(!showExercises);
        if (!showExercises) {
            getExercises();
        }
    };

    const newTable = () => {
        Axios.post('http://localhost:3001/createTable', {
            tableName: tableName,
        }).then(() => {
            setTableName('')
        }).catch(error => {
            console.error('Error adding exercise:', error);
        });
    };

    const handleClick = () => {
        setShowMessage(!showMessage);
        if (!showMessage) {
            toggleShowExercises(); // Fetch exercises when showMessage is toggled
        }
    };

    const deleteExercise = (id) => {
        Axios.delete(`http://localhost:3001/exercise/${id}`)
            .then(() => {
                setExerciseList(exerciseList.filter(exercise => exercise.id !== id));
            })
            .catch(error => console.error('Error deleting exercise:', error));
    };

    const addFullExercise = () => {
        Axios.post('http://localhost:3001/create', {
            exercise: exercise,
            sets: sets,
            reps: reps,
            weight: weight
        }).then(() => {
            setExerciseList([...exerciseList, {
                exercise: exercise,
                sets: sets,
                reps: reps,
                weight: weight
            }]);
            setExercise("");
            setSets(0);
            setReps("");
            setWeight("");
        }).catch(error => {
            console.error('Error adding exercise:', error);
        });
    };

    return (
        <div>
            <input type="text" value={tableName} onChange={(event) => setTableName(event.target.value)} placeholder="Enter Workout Name" style={{ display: !showMessage ? 'block' : 'none' }} />
            <button onClick={handleClick}>
                {showMessage ? 'Finish' : 'Create New Workout'}
            </button>
            {showMessage && (
                <div>
                    <div>Add Your Exercises</div>
                    <table>
                        <thead>
                            <tr>
                                <th>Name</th>
                                <th>Sets</th>
                                <th>Reps</th>
                                <th>Weight</th>
                                <th>Action</th>
                            </tr>
                        </thead>
                        <tbody>
                            {exerciseList.map(exercise => (
                                <tr key={exercise.id}>
                                    <td>{exercise.name}</td>
                                    <td>{exercise.sets}</td>
                                    <td>{exercise.reps}</td>
                                    <td>{exercise.weight}</td>
                                    <td>
                                        <button onClick={() => deleteExercise(exercise.id)}>Delete</button>
                                    </td>
                                </tr>
                            ))}
                            <tr>
                                <td><input type="text" value={exercise} onChange={(event) => setExercise(event.target.value)} /></td>
                                <td><input type="number" value={sets} onChange={(event) => setSets(event.target.value)} /></td>
                                <td><input type="text" value={reps} onChange={(event) => setReps(event.target.value)} /></td>
                                <td><input type="text" value={weight} onChange={(event) => setWeight(event.target.value)} /></td>
                                <td><button onClick={addFullExercise}>Add Exercise</button></td>
                            </tr>
                        </tbody>
                    </table>
                </div>
            )}
        </div>
    );
};

export default AddWorkout;
